import './App.css';
import axios from 'axios'
import { useState } from 'react';
import { Button, Container } from 'react-bootstrap'

function App() {

  const [properties, setProperties] = useState([])
  const [displayResult, setDisplayResult] = useState('none')

  const handleSubmit = async (event) => {
    event.preventDefault()
    await axios.get('http://localhost:8000/huurwoningen/')
      .then(response => {
        setProperties(response.data)
        setDisplayResult('block')
        console.log(response.data)
      })
      .catch(error => {
        console.log('not worked')
        setProperties(['not good'])
      })
  }

  return (
    <Container className="d-flex align-items-center">
      <h1 style={{textAlign: 'center'}}>Huurwoningen's listings </h1>
      <Button onClick={handleSubmit} variant="dark" className="align-items-center">Press me!</Button>
      <ul style={{display: displayResult}}>
        {properties.map((element, index) => {
          return(
            <li key={index}>
              <a href={element[1]} style={{color: '#000', textDecoration: 'none'}}>{element[0]}</a>
            </li>
          )
        })}
      </ul>
    </Container>
  );
}

export default App;
